    public int smallestRangeI(int[] nums, int k) {
        if (nums == null || nums.length < 2) return 0;
        int max = nums[0];
        int min = nums[0];
        for (int i : nums) {
            max = Math.max(max, i);
            min = Math.min(min, i);
        }
        return Math.max(max - min - 2 * k, 0);
    }

    public boolean hasGroupsSizeX(int[] deck) {
        if (deck == null || deck.length < 2) return false;

        Map<Integer, Integer> map = new HashMap<>();
        for (int i : deck) {
            map.put(i, map.getOrDefault(i, 0) + 1);
        }

        int minRepeat = Integer.MAX_VALUE;
        int secondMin = Integer.MAX_VALUE;
        for (Map.Entry<Integer, Integer> entry : map.entrySet()) {
            int val = entry.getValue();
            if (val <= minRepeat) minRepeat = val;
            else if (val < secondMin) secondMin = val;
        }

        int commonLen = gcd(secondMin, minRepeat);
        if (commonLen == 1) return false;
        for (Map.Entry<Integer, Integer> entry : map.entrySet()) {
            int val = entry.getValue();
            if (val < 2) return false;
            if (val % commonLen != 0) return false;
        }
        return true;
    }

    public int gcd(int m, int n) {
        if (m == Integer.MAX_VALUE) return n;
        while (n != 0) {
            int left = m % n;
            m = n;
            n = left;
        }
        return m;
    }

    public boolean hasGroupsSizeX2(int[] deck) {
        if (deck == null || deck.length < 2) return false;

        Map<Integer, Integer> map = new HashMap<>();
        for (int i : deck) {
            map.put(i, map.getOrDefault(i, 0) + 1);
        }

        int g = -1;
        for (Map.Entry<Integer, Integer> entry : map.entrySet()) {
            int val = entry.getValue();
            if (g == -1) {
                g = val;
            } else {
                g = gcd2(val, g);
            }
            if (g < 2) return false;
        }
        return true;
    }

    public int gcd2(int m, int n) {
        return n == 0 ? m : gcd2(n, m % n);
    }
